import React, { Component } from 'react'
class Twopix extends Component {
    render() {
        return (
            <div className={`twopix col-12 border  ${this.props.class}`}
                style={{
                    backgroundImage: `url(${this.props.image})`, backgroundSize: 'cover',
                    backgroundPosition: "center",
                    backgroundRepeat: "no-reapeat"
                }}
            >

            </div>
        )
    }
}
export default Twopix
